import MSFTCaption, { CaptionSize, CaptionTag, } from "./caption";
import captionSchema from "./caption.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { CaptionStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Caption = manageJss(CaptionStyles)(MSFTCaption);
export { Caption, CaptionSize, CaptionTag, captionSchema, };
